--  REMARKS: This is the SQL file for the Chicago crashes dataset 
--  
-- Data obtained from the city of Chicago
-- https://catalog.data.gov/dataset/traffic-crashes-crashes
-- https://catalog.data.gov/dataset/traffic-crashes-vehicles
-- https://catalog.data.gov/dataset/traffic-crashes-people

use cs3380;

BEGIN TRANSACTION;
drop table if exists pedestrian;
drop table if exists passenger;
drop table if exists cyclist;
drop table if exists driver;
drop table if exists vehicles;
drop table if exists damages;
drop table if exists crashFactor;
drop table if exists climateCondition;
drop table if exists trafficCondition;
drop table if exists roadCondition;
drop table if exists injury;
drop table if exists crashes;
drop table if exists location;

CREATE TABLE location (
  locationID INTEGER PRIMARY KEY,
  streetName VARCHAR(MAX),
  streetNumber INTEGER,
  streetDirection VARCHAR(MAX),
  beatOfOccurence INTEGER
);

CREATE TABLE crashes (
  crashID VARCHAR(255) PRIMARY KEY,
  locationID INTEGER,
  reportType VARCHAR(MAX),
  crashHour INTEGER,
  crashDayOfWeek INTEGER,
  crashMonth INTEGER,
  crashYear INTEGER,
  notRightOfWay VARCHAR(MAX),
  hitAndRun VARCHAR(MAX),
  FOREIGN KEY (locationID) REFERENCES location(locationID)
);

CREATE TABLE injury (
  injuryID INTEGER PRIMARY KEY,
  crashID VARCHAR(255),
  mostSevereInjury VARCHAR(MAX),
  totalInjuries INTEGER,
  fatalInjuries INTEGER,
  incapacitatingInjuries INTEGER,
  nonIncapacitatingInjuries INTEGER,
  injuriesReportedNotEvident INTEGER,
  injuriesNoIndication INTEGER,
  unknownInjuries INTEGER
  FOREIGN KEY (crashID) REFERENCES crashes(crashID)
);

CREATE TABLE roadCondition (
  roadID INTEGER PRIMARY KEY,
  crashID VARCHAR(255),
  roadDefect VARCHAR(MAX),
  roadwaySurfaceCondition VARCHAR(MAX),
  alignment VARCHAR(MAX),
  trafficwayType VARCHAR(MAX),
  FOREIGN KEY (crashID) REFERENCES crashes(crashID)
);

CREATE TABLE trafficCondition (
  trafficID INTEGER PRIMARY KEY,
  crashID VARCHAR(255),
  postedSpeedLimit INTEGER,
  trafficControlDevice VARCHAR(MAX),
  deviceCondition VARCHAR(MAX),
  FOREIGN KEY (crashID) REFERENCES crashes(crashID)
);

CREATE TABLE climateCondition (
  climateID INTEGER PRIMARY KEY,
  crashID VARCHAR(255),
  weatherCondition VARCHAR(MAX),
  lightingCondition VARCHAR(MAX),
  FOREIGN KEY (crashID) REFERENCES crashes(crashID)
);

CREATE TABLE crashFactor (
  factorID INTEGER PRIMARY KEY,
  crashID VARCHAR(255),
  climateID INTEGER,
  roadID INTEGER,
  trafficID INTEGER,
  primaryCause VARCHAR(MAX),
  secondaryCause VARCHAR(MAX),
  FOREIGN KEY (crashID) REFERENCES crashes(crashID),
  FOREIGN KEY (climateID) REFERENCES climateCondition(climateID),
  FOREIGN KEY (roadID) REFERENCES roadCondition(roadID),
  FOREIGN KEY (trafficID) REFERENCES trafficCondition(trafficID)
);

CREATE TABLE damages (
    damageID INTEGER IDENTITY(1,1) PRIMARY KEY,
    crashID VARCHAR(255),
    firstCrashType VARCHAR(MAX),
    crashType VARCHAR(MAX),
    cost INTEGER,
    numUnits INTEGER,
    FOREIGN KEY (crashID) REFERENCES crashes(crashID)
);

CREATE TABLE vehicles (
  crashUnitID INTEGER PRIMARY KEY,
  crashID VARCHAR(255),
  vehicleID INTEGER,
  damageID INTEGER,
  unitNumber INTEGER,
  unitType VARCHAR(MAX),
  numPassengers INTEGER,
  vehicleMake VARCHAR(MAX),
  vehicleModel VARCHAR(MAX),
  licencePlateState VARCHAR(MAX),
  vehicleYear INTEGER,
  vehicleDefect VARCHAR(MAX),
  vehicleType VARCHAR(MAX),
  vehicleUse VARCHAR(MAX),
  travelDirection VARCHAR(MAX),
  maneuver VARCHAR(MAX),
  occupantCount INTEGER,
  FOREIGN KEY (crashID) REFERENCES crashes(crashID),
  );

CREATE TABLE cyclist (
  personID VARCHAR(255) PRIMARY KEY,
  personType VARCHAR(MAX),
  injuryID INTEGER,
  crashID VARCHAR(255),
  city VARCHAR(MAX),
  state VARCHAR(MAX),
  zipcode INTEGER,
  sex VARCHAR(MAX),
  age VARCHAR(MAX),
  safetyEquipment VARCHAR(MAX),
  ejection VARCHAR(MAX),
  injuryClassification VARCHAR(MAX),
  driverAction VARCHAR(MAX),
  driverVision VARCHAR(MAX),
  physicalCondition VARCHAR(MAX),
  pedpedalAction VARCHAR(MAX),
  pedpedalVisibility VARCHAR(MAX),
  pedpedalLocation VARCHAR(MAX),
  year INTEGER,
  date VARCHAR(MAX),
  time VARCHAR(MAX),
  FOREIGN KEY (injuryID) REFERENCES injury(injuryID),
  FOREIGN KEY (crashID) REFERENCES crashes(crashID)
);

CREATE TABLE driver (
    personID VARCHAR(255) PRIMARY KEY,
    personType VARCHAR(MAX),
    crashID VARCHAR(255),
    injuryID INTEGER,
    crashUnitID INTEGER,
    vehicleID INTEGER,
    city VARCHAR(MAX),
    state VARCHAR(MAX),
    zipcode INTEGER,
    sex VARCHAR(MAX),
    age INTEGER,
    driversLicenseState VARCHAR(MAX),
    driversLicenseClass VARCHAR(MAX),
    safetyEquipment VARCHAR(MAX),
    airbagDeployed VARCHAR(MAX),
    ejection VARCHAR(MAX),
    injuryClassification VARCHAR(MAX),
    driverAction VARCHAR(MAX),
    driverVision VARCHAR(MAX),
    physicalCondition VARCHAR(MAX),
    bacResults VARCHAR(MAX),
    bacResultsValue INTEGER,
    year INTEGER,
    date VARCHAR(MAX),
    time VARCHAR(MAX),
    FOREIGN KEY (crashID) REFERENCES crashes(crashID),
    FOREIGN KEY (injuryID) REFERENCES injury(injuryID),
    FOREIGN KEY (crashUnitID) REFERENCES vehicles(crashUnitID)
);

CREATE TABLE "passenger" (
    personID VARCHAR(255) PRIMARY KEY,
    personType VARCHAR(MAX),
    crashID VARCHAR(255),
    injuryID INTEGER,
    vehicleID INTEGER,
    seatNum INTEGER,
    city VARCHAR(MAX),
    state VARCHAR(MAX),
    zipcode VARCHAR(MAX),
    sex VARCHAR(MAX),
    age INTEGER,
    safetyEquipment VARCHAR(MAX),
    airbagDeployed VARCHAR(MAX),
    ejection VARCHAR(MAX),
    injuryClassification VARCHAR(MAX),
    year INTEGER,
    date VARCHAR(MAX),
    time VARCHAR(MAX)
    FOREIGN KEY (crashID) REFERENCES crashes(crashID),
    FOREIGN KEY (injuryID) REFERENCES injury(injuryID)
);

CREATE TABLE pedestrian (
  personID VARCHAR(255) PRIMARY KEY,
  personType VARCHAR(MAX),
  crashID VARCHAR(255),
  injuryID INTEGER,
  crashDate VARCHAR(MAX),
  city VARCHAR(MAX),
  state VARCHAR(MAX),
  zipcode INTEGER,
  sex VARCHAR(MAX),
  age INTEGER,
  safetyEquipment VARCHAR(MAX),
  injuryClassification VARCHAR(MAX),
  driverAction VARCHAR(MAX),
  driverVision VARCHAR(MAX),
  physicalCondition VARCHAR(MAX),
  pedpedalAction VARCHAR(MAX),
  pedpedalVisibility VARCHAR(MAX),
  pedpedalLocation VARCHAR(MAX),
  year INTEGER,
  date VARCHAR(MAX),
  time VARCHAR(MAX),
  FOREIGN KEY (crashID) REFERENCES crashes(crashID),
  FOREIGN KEY (injuryID) REFERENCES injury(injuryID)
);













COMMIT;